import React, { useEffect, useState } from 'react';
import { SafeAreaView, View } from 'react-native';
import { Button, makeStyles, Overlay } from 'react-native-elements';
import { LIBRETWOAPP } from '../../Settings/glucoseSourceConstants';
import LocalizationContext from '../../../../LanguageContext';
import { useUserSettings } from '../../../hooks/useUserSettings';
import RNFetchBlob from 'rn-fetch-blob';
import { IMAGECONVERTER_API } from '@env';
import * as ImagePicker from 'react-native-image-picker';
import PermissionAlert from '../../../Common/PermissionAlert';
import uuid from 'react-native-uuid';
import { database } from '../../../Common/database_realm';

const AddLibreData = props => {
  const { t } = React.useContext(LocalizationContext);
  const styles = useStyles();
  const { userSettings } = useUserSettings();
  const [isVisible, setIsVisible] = useState(false);
  const [chartImage, setChartImage] = useState(null);

  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
      if (chartImage && chartImage.length > 0) {
    uploadImage();
    }
  }, [chartImage]);

  const image =
    '';

  const getTimeLine = ({ x, y }) => {
    const d = new Date(props.date);
    d.setHours(0, 0, x * 3600, 0);
    console.log(d.toISOString());
    console.log(d.getTime());
    return {
      _id: uuid.v4(),
      device: 'meala-Libre-Import',
      date: d.getTime(),
      dateString: d.toISOString(),
      sgv: y,
      type: 'sgv',
    };
  };

  function selectLibraryTapped() {
    ImagePicker.launchImageLibrary(
      {
        mediaType: 'photo',
        includeBase64: true,
      },
      response => {
        if (response.didCancel) {
          console.log('User cancelled photo picker');
        } else if (response.errorCode) {
          console.log('ImagePicker Error: ', response.errorCode);
          if (response.errorCode === 'permission') {
            PermissionAlert(t);
          }
        } else {
          setChartImage(response.base64);
        }
      },
    );
  }

  function uploadImage() {
    setLoading(true);
    RNFetchBlob.fetch(
      'POST',
      IMAGECONVERTER_API,
      {
        'Content-Type': 'multipart/form-data',
      },
      [
        {
          name: 'chart',
          filename: 'image.jpg',
          type: 'image/jpg',
          data: chartImage,
        },
        { name: 'date', data: '2021-07-16T19:20:30.45+02:00' },
      ],
    )
      .then(response => response.json())
      .then(result => {
        console.log(result);
        const chartData = result.map(getTimeLine);
        setData(chartData);
        database.editMealCgmData(chartData, props.userMealId);
        setLoading(false);
      })
      .catch(error => console.log('error', error));
  }

  return (
    <>
      {userSettings.glucoseSource === LIBRETWOAPP && (
        <View style={{ padding: 8 }}>
          <Button title={'Fge deine Libre Daten hinzu'} onPress={() => setIsVisible(true)} />
        </View>
      )}
      <Overlay
        isVisible={isVisible}
        windowBackgroundColor="rgba(255, 255, 255, .5)"
        fullScreen={true}
        title={'Change Time'}
        overlayStyle={styles.overlay}>
        <SafeAreaView>
          <Button loading={loading} title={'Select Libre Chart'} onPress={() => selectLibraryTapped()} />
          {chartImage && <Button loading={loading} title={''} onPress={() => uploadImage()} />}
          <Button
            type={'clear'}
            buttonStyle={{ backgroundColor: 'transparent' }}
            onPress={() => setIsVisible(false)}
            title={t('General.close')}
          />
        </SafeAreaView>
      </Overlay>
    </>
  );
};

export default AddLibreData;

const useStyles = makeStyles(theme => ({}));
